import React from 'react'
import './Footer.css'
import logo from '../assets/logo.png';
const Footer = () => {
  return (
    <div className='footer'>
      <div className="footer_elements">
     <h3>social media</h3>
     <h3>contact</h3>
     <h3>help</h3>
     <h3>suggestions</h3>
      </div>
    </div>
  )
}

export default Footer
